function() {
  // Check if the data layer variable exists and has the desired value
  if (window.dataLayer && window.dataLayer.length > 0) {
    // Loop through the data layer to find the desired value
    for (var i = 0; i < window.dataLayer.length; i++) {
      var event = window.dataLayer[i];
      // Check if the event has the desired name
      if (event.event && (event.event === 'Save/Follow' || event.event === "Unsave/Unfollow")) {
        // Check if the event has the event_label parameter
        if (event.event_label) {
          // Return the value of the event_label parameter
          return event.event_label;
        } else {
          // If event_label parameter is not present, return null
          return null;
        }
      }
    }
  }
  // If the event is not found or event_label parameter is not present, return null
  return null;
}
